import images from "../src/images.png"

const App = () => {

  const clickIcon = () => {
    console.log("clicked")
  }

  return (
    <>
      <Balloon
        children="a"
        className="balloon2"
        style={{ position: 'absolute', top: '200px' }}
      />
      <Img width="128" src={images} />
      <Heading
        children="見出し"
        className='h2 h'
        style={{color:"red"}}
      />
      <Icon
        className='clickable'
        onClick={clickIcon}
        src={images}
      />
      <Txt
        className="default l warning"
        text="テキスト"
        // style={{background:"blue"}}
      />
      <DeleteIcon className=" root"/>
    </>
  );
};

export default App;
